INSERT INTO `v1_b5b75089bbea3e8f88d466febc30d43722e68857680cd87864c98df21a2e9e10` VALUES (40011, 1, "もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", 1, 2, 0, 24001, 321, 1, 125801, "リリ");
INSERT INTO `v1_b5b75089bbea3e8f88d466febc30d43722e68857680cd87864c98df21a2e9e10` VALUES (40011, 2, "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", 1, 2, 0, 24001, 322, 1, 126001, "クリア");
INSERT INTO `v1_b5b75089bbea3e8f88d466febc30d43722e68857680cd87864c98df21a2e9e10` VALUES (40011, 3, "んーと。\nこれ、あげる。\nはい", 1, 2, 0, 24001, 323, 1, 126101, "プレシア");
INSERT INTO `v1_b5b75089bbea3e8f88d466febc30d43722e68857680cd87864c98df21a2e9e10` VALUES (40011, 4, "あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", 1, 2, 0, 24001, 324, 2, 125801, "リリ");
INSERT INTO `v1_b5b75089bbea3e8f88d466febc30d43722e68857680cd87864c98df21a2e9e10` VALUES (40011, 5, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 1, 2, 0, 24001, 325, 2, 126001, "クリア");
INSERT INTO `v1_b5b75089bbea3e8f88d466febc30d43722e68857680cd87864c98df21a2e9e10` VALUES (40011, 6, "お兄。\nきてくれて、うれしい", 1, 2, 0, 24001, 326, 2, 126101, "プレシア");
